import React from 'react';
import { FaCoins } from 'react-icons/fa';
import Container from '../../components/Container';
import { Content, Title, StoreProducts, Product } from './styles';

const Store: React.FC = () => {
  return (
    <Container>
      <Content>
        <Title>
          <strong>Ola, Fulano de Tal.</strong>
          <p>Você possui 500 coins para resgatar produtos.</p>
        </Title>
        <StoreProducts>
          <Product>
            <img
              src="https://avatars2.githubusercontent.com/u/48379411?s=400&u=94dabeb8a22a6181fc4686a5bee1e608fa477f86&v=4"
              alt="Name Product"
            />
            <span> Descrição Produto</span>
            <Price>
              <FaCoins size={50} color="##F0D126" />
            </Price>
          </Product>
        </StoreProducts>
      </Content>
    </Container>
  );
};

export default Store;
